import React from "react";
const Hes=()=>{
    return(
        <>
$(document).on('scroll',function(){
    $('h1').css("left",Math.max(500))
})

        </>
    );
};




const Hello=()=>{
    return(
        <>
        
        <div className="black">
        <div className="container-fluid">
        <div className="row">
                <div className="hello">
<h1>HELLO</h1>
                </div>
                </div>
        </div>
        <div className="container-fluid">
        <div className="row">
        <div className="world">
<h1>
    WORLD
</h1>
        </div>
                
                </div>
        </div>
        </div>
        </>

    );
};

export default Hello;
